import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Footer from './component/Footer';
import Header from './component/Header';
import Home from './pages/Home'
import { Container } from 'react-bootstrap';


function App() {


  return (<Row>
    <Header />
    <Container fluid>
      <Home />
    </Container>
    <Footer />
  </Row>
  );
}

export default App;
